import "./App.css";
import Rotas from "./routes";
import { userContext } from "./context/AuthContext";
import { useState } from "react";

function App() {
  const [user, setUser] = useState(userContext);

  return (
    <UserContext.Provider value={{ user, setUser }}>
      <Rotas />
    </UserContext.Provider>
  );
}

export default App;
